  [],\n\t\"revision_timestamp\": \"2015-05-07T15:21:40.232190\",\n\t\"name\": \"data-concentrator-for-modular-and-distributed-control-of-propulsion-systems-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Orbital Research proposes to develop, build
  and test 3 additional high temperature components for use in the design of a Data
  Concentrator Module in distributed turbine engine control at high temperatures.
  \ The concentrator receives analog and digital signals related to turbine engine
  control and communicates with a FADEC or high level command processor. This data
  concentrator follows the road map put forth by DECWG for use in creating a demonstration
  platform for turbine engine distributed controls communication development that
  operates at temperatures at least up to 225C.rnrnPhase I was the development of
  detailed specifications for each component needed for the system, as well as to
  define the total system specification.  This entailed a combination of system design,
  compiling existing component specifications, laboratory testing, and simulation.
  \ The results showed the feasibility of the data concentrator.rnrnPhase II of this
  program will focus on three key objectives:rnThe first objective will be to update
  Data Concentrator design modifications from DECWG and Prime Contractors.  Secondly,
  to define the requirements for the three new high temperature ASICs.  Finally to
  validate each design by testing over temperature and under load.\",\n\t\"license_title\":
